/*Table structure for table `sira_persona` */

DROP TABLE IF EXISTS `sira_persona`;

CREATE TABLE `sira_persona` (
  `id` bigint(20) NOT NULL auto_increment,
  `cedula` varchar(45) default NULL,
  `nombres` varchar(45) NOT NULL,
  `apellidos` varchar(45) NOT NULL,
  `sexo` varchar(1) NOT NULL,
  `direccion` varchar(45) default NULL,
  `telefono` varchar(255) default NULL,
  `celular` varchar(255) default NULL,
  `email` varchar(255) default NULL,
  `ocupacion` varchar(255) default NULL,
  `parentesco` varchar(255) default NULL,
  `fecha_nacimiento` datetime NOT NULL,
  `fecha_registro` datetime default NULL,
  `id_padre` bigint(20) default NULL,
  `id_madre` bigint(20) default NULL,
  `provincia_nac` varchar(255) default NULL,
  `canton_nac` varchar(255) default NULL,
  `parroquia_nac` varchar(255) default NULL,
  `estado_civil` varchar(255) default NULL,
  `id_provincia_nacimiento` bigint(20) default NULL,
  `id_canton_nacimiento` bigint(20) default NULL,
  `id_parroquia_nacimiento` bigint(20) default NULL,
  `auditCreateDate` datetime default NULL,
  `auditUpdateDate` datetime default NULL,
  `auditCreateUser` varchar(45) default NULL,
  `auditUpdateUser` varchar(45) default NULL,
  `cargo` varchar(255) default NULL,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `cedula` (`cedula`),
  KEY `FKE15C80727FCEE25C` (`id_madre`),
  KEY `FKE15C80727FF928DF` (`id_padre`),
  KEY `FKE15C8072B6B4365E` (`id_canton_nacimiento`),
  KEY `FKE15C8072627E6F52` (`id_provincia_nacimiento`),
  KEY `FKE15C8072B0134132` (`id_parroquia_nacimiento`),
  KEY `FKE15C807296E33551` (`id_madre`),
  KEY `FKE15C8072970D7BD4` (`id_padre`),
  CONSTRAINT `FKE15C8072627E6F52` FOREIGN KEY (`id_provincia_nacimiento`) REFERENCES `loc_provincia` (`id`),
  CONSTRAINT `FKE15C80727FCEE25C` FOREIGN KEY (`id_madre`) REFERENCES `sira_persona` (`id`),
  CONSTRAINT `FKE15C80727FF928DF` FOREIGN KEY (`id_padre`) REFERENCES `sira_persona` (`id`),
  CONSTRAINT `FKE15C807296E33551` FOREIGN KEY (`id_madre`) REFERENCES `sira_persona` (`id`),
  CONSTRAINT `FKE15C8072970D7BD4` FOREIGN KEY (`id_padre`) REFERENCES `sira_persona` (`id`),
  CONSTRAINT `FKE15C8072B0134132` FOREIGN KEY (`id_parroquia_nacimiento`) REFERENCES `loc_parroquia` (`id`),
  CONSTRAINT `FKE15C8072B6B4365E` FOREIGN KEY (`id_canton_nacimiento`) REFERENCES `loc_canton` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

